import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { connect } from 'react-redux';
import firebase from '../../firebaseTest.js';
import PropTypes from 'prop-types';

import {
    Button,
    TextField,
    AppBar
} from '../../components';
import './styles.css';

function MoveComponent(props) {
    const { classes } = props;
    return (
        <div style={{margin:'10px'}}>
            <AppBar /> 
            <h2>Please Login</h2>
            <TextField id='user' placeholder='username' style={{marginBottom:'10px'}}/><br/>
            <TextField id='password' type='password' placeholder='password' style={{marginBottom:'10px'}}/>
                <br/>
            <Button variant="contained" color="primary" >Pause</Button> 
            <Button>Login</Button>
            <Button></Button>
        </div>
    )
}

MoveComponent.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export { MoveComponent };

const mapStateToProps = (state, ownProps) => {
    return {
        ...ownProps
    };
};

export const Login = connect(mapStateToProps, {

})(MoveComponent);
